def count_possible_strings(N, c_AA, c_AB, c_BA, c_BB):
    mod = 1000000007
    if N <= 3:
        return 1
    if c_AB == 'A':
        if c_AA == 'A':
            return 1
        else:
            dp = [[0] * 2 for _ in range(N - 3)]
            dp[0][0] = 1
            dp[0][1] = 1
            for i in range(1, N - 3):
                dp[i][0] = sum(dp[i - 1]) % mod
                dp[i][1] = dp[i - 1][0]
            if c_BA == 'A':
                return sum(dp[-1]) % mod
            else:
                return pow(2, N - 3, mod)
    elif c_BB == 'B':
        return 1
    else:
        dp = [[0] * 2 for _ in range(N - 3)]
        dp[0][0] = 1
        dp[0][1] = 1
        for i in range(1, N - 3):
            dp[i][0] = sum(dp[i - 1]) % mod
            dp[i][1] = dp[i - 1][0]
        if c_BA == 'B':
            return sum(dp[--1]) % mod
        else:
            return pow(2, N - 3, mod)
